  alias: "@";
  data-relative-path: "json/fonts.json";
  file-path-base: "~@/fonts";
}
","*,
*:--ab {
  box-sizing: inherit;
}

html {
  --color_page-background: $color-page-background;
  --page-min-width: $page-min-width;

  box-sizing: border-box;
}

body {
  margin: 0;
  font-weight: 400;
  font-style: normal;
  font-size: 16px;
  line-height: 1;
  font-family: "Source Sans Pro", "Arial", sans-serif;
  color: black;
}

img,
svg,
picture,
video {
  display: block;
}

button {
  display: block;
  cursor: pointer;
}
",".s_button {
  padding: 8px 16px;
  border-style: none;
  font-size: inherit;
  background-color: #cdcdcd;
}

.s_input {
  padding: 8px;
  border: 1px solid #bababa;
  border-radius: 2px;
  font-size: inherit;
  background-color: white;
}

.s_list {
  margin-top: 0;
  margin-bottom: 0;
  padding-left: 0;
  list-style-type: none;
}

.s_visually-hidden {
  &:not(:active, :focus),
  &:matches(input[type="checkbox"]),
  &:matches(input[type="radio"]) {
    @include visually-hiding();
  }
}
","@mixin visually-hiding() {
  appearance: none;
  margin: -1px;
  width: 1px;
  height: 1px;
  overflow: hidden;
  border-style: none;
  padding: 0;
  white-space: nowrap;
  clip: rect(0 0 0 0);
  clip-path: inset(100%);
}
",".control-bar {
  display: flex;
  flex-direction: column;
}

.control-bar__filter {
  margin-bottom: 16px;
}

.control-bar__searchbar {
  display: flex;
  margin-top: 0;
  margin-bottom: 0;
  font-size: 20px;
}

.control-bar__wrapper {
  display: flex;
  flex-direction: column;
}
",".filter {
  display: flex;
  flex-wrap: wrap;

  @media (--vp-xs-from) {
    flex-wrap: nowrap;
    align-items: center;
  }
}

.filter__tip {
  margin-top: 0;
  margin-bottom: 16px;
  width: 100%;
  font-size: 18px;

  @media (--vp-xs-from) {
    margin-bottom: 0;
    margin-right: 16px;
    width: auto;
  }
}

.filter__controls {
  display: flex;
  overflow: hidden;
  border-radius: 2px;
}

.filter__control {
  min-width: 120px;
  transition: color, background-color 0.25s;

  &.js_active {
    background-color: darkslateblue;
    color: lightgoldenrodyellow;
  }
}
",".page__heading {
  margin-top: 0;
  margin-bottom: 48px;
  line-height: 1.25;
}
",".page__overlay {
  position: absolute;
  z-index: 1;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100vh;
  background-color: rgba(0, 0, 0, 0.25);

  &.js_hidden {
    display: none;
  }
}
",".page__wrapper {
  --color_conic-dark: #eeeeee;

  width: 100%;
  max-width: 672px;
  min-height: 100vh;
  padding: 48px 24px;
  background-color: white;
  background-image: conic-gradient(
    at center 50vh,
    var(--color_conic-dark) 120deg,
    white 180deg,
    var(--color_conic-dark) 360deg
  );
  background-attachment: fixed;
}
",".page {
  position: relative;
  z-index: 0;
  display: flex;
  flex-direction: column;
  align-items: center;
  min-width: var(--page-min-width);
  overflow-y: scroll;
  background-color: var(--color_page-background);
}
",".page-content__filter {
  margin-bottom: 32px;
}
","@keyframes spinner-rotation {
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(360deg);
  }
}

.spinner {
  width: 100px;
  height: 100px;
  border: 10px solid $color-spinner;
  border-right-color: transparent;
  border-radius: 50%;
  animation-name: spinner-rotation;
  animation-duration: 1s;
  animation-timing-function: linear;
  animation-iteration-count: infinite;
}
",".subjects__button {
  margin-top: 40px;
  margin-left: auto;
  margin-right: auto;
  font-size: 20px;
}

.subjects__item {
  line-height: 1.25;

  @nest .subjects__list > * + & {
    margin-top: 16px;
  }
}

.subjects__link {
  color: midnightblue;
}

.subjects__tags {
  display: inline;
  font-style: italic;
}

.subjects__tag {
  display: inline;
}

.subjects__lang-badge {
  display: inline-block;
  border-radius: 2px;
  padding-left: 2px;
  padding-right: 2px;
  font-size: 12px;
  line-height: 16px;
  text-transform: uppercase;
  color: white;
}

.subjects__lang-badge--en {
  background-color: #90caf9;
}

.subjects__lang-badge--ru {
  background-color: #80cbc4;
}
",".text-input {
  flex-grow: 1;
}

.text-input__field {
  width: 100%;
}
